import React from "react";
import {BrowserRouter as Router, Redirect, Route} from "react-router-dom";
import Header from "./Header";

export default () => (

    <Router>
        <>
            <Route path="/" component={Header} />
            <Redirect from="*" to="/user" />
        </>
    </Router>
)
